  //       transition: all 0.5s ease;
  //       }
  //       .menu ul li a:hover{
  //       background: #000048;
  //       color: whitesmoke;
  //       }

  

  const [state, setState] = useState({
    user_name            : "",
    user_dateOfBirth     : "",
    user_gender          : "",
    user_email           : "",
    user_phone           : "",
    user_state           : "",
    user_city            : "",
    user_college         : "",
    user_degree          : "",
    user_degree_marks    : "",
    user_GradPassoutYear : "",
    user_school          : "",
    user_major           : "",
    user_HS_marks        : "",
    user_HSpassoutYear   : "",
    user_skills          : "",
    user_workExp         : "",
    user_ExpYears        : "",
    user_language        : ""
  });

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setState((prevProps) => ({
      ...prevProps,
      [name]: value
    }));
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log(state);
  };

return (
  <div className="Career">
  <body>
  <nav>
            <div class="menu">
                <div class="logo">
                <a href="/">Portfolio</a>
                </div>
                <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/career">Career</a></li>
                <li><a href="/contact">Contact</a></li>
                </ul>
            </div>
            </nav>
            <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>
  <form onSubmit={handleSubmit}>
  <div className="form-control">
      <label>Name</label>
      <input
        type="text"
        name="name"
        value={state.name}
        onChange={handleInputChange}
      />
    </div>
    <div className="form-control">
      <label>DOB</label>
      <input
        type="date"
        name="dob"
        value={state.dob}
        onChange={handleInputChange}
      />
    </div>
    <div className="form-control">
      <label>Male</label>
      <input type="radio" name="user_gender" value={state.gender}
						required/>
            <label>Female</label><input type="radio"
						name="user_gender" value={state.gender} required/>
    </div>
    <div className="form-control">
      <label>Email</label>
      <input
        type="text"
        name="email"
        value={state.email}
        onChange={handleInputChange}
      />
    </div>
    <div className="form-control">
      <label>Password</label>
      <input
        type="password"
        name="password"
        value={state.password}
        onChange={handleInputChange}
      />
    </div>
    <br></br>
    <div id="btn">
      <input type="submit" value="Submit"></input>
    </div>
  </form>
  </body>
</div>
);
}
